def is_plural(word):
    if known_plural(word):
        return True
    if known_singular(word):
        return False
    for rule in plural_recognize_rules:
        if rule.match(word):
            return True
    return False

def is_singular(word):
    if known_singular(word):
        return True
    if known_plural(word):
        return False
    for rule in singular_recognize_rules:
        if rule.match(word):
            return True
    return not is_plural(word)

